import React from 'react';
import { Button, Card, Form, Input } from 'antd'; // Importing components from Ant Design library

const LowCodeForm = () => {
  const onFinish = (values) => {
    console.log('Received values:', values);
  };

  return (
    <Card title="Low-Code Form">
      <Form onFinish={onFinish}>
        <Form.Item
          label="Username"
          name="username"
          rules={[{ required: true, message: 'Please input your username!' }]}
        >
          <Input />
        </Form.Item>

        <Form.Item
          label="Password"
          name="password"
          rules={[{ required: true, message: 'Please input your password!' }]}
        >
          <Input.Password />
        </Form.Item>

        <Form.Item>
          <Button type="primary" htmlType="submit">
            Submit
          </Button>
        </Form.Item>
      </Form>
    </Card>
  );
};

export default LowCodeForm;
